INSERT INTO `about` (`id`, `title`, `text`) VALUES
(1, 'VISI', 'Menjadi produsen tepung paling kompetitif se Asia tenggara'),
(2, 'MISI', 'Kami berusaha untuk menyediakan produk dan layanan yang terbaik dengan harga yang terjangkau untuk semua pelanggan kami'),
(3, '', 'Kami menghargai karyawan kami, elemen inti dari perusahaan'),
(4, '', 'Kami menjamin keuntungan yang memuaskan kepada seluruh pemegang saham dan pemenuhan semua komitmen kami kepada bank dan pemasok'),
(5, '', 'Kami akan memberikan kontribusi menuju perbaikan kesejahteraan sosial masyarakat di mana kami beroperasi'),
(6, '', ''),
(7, '', ''),
(8, 'NILAI-NILAI PERUSAHAAN :', ''),
(9, '1.INTEGRITAS', 'Perilaku kami tercermin pada perusahaan kami Sriboga Flour Mill menghargai integritas sebagai dasar utama untuk semua aktivitas kerja yang harus dianut dan dipatuhi oleh setiap individu dalam perusahaan sebagai contoh untuk dan untuk kepentingan perusahaan itu sendiri dan masyarakat di mana ia beroperasi'),
(10, '2.KOMITMEN', 'Pelanggan dan pemegang saham adalah masa depan kita dan masa depan perusahaan kami. Komitmen dan janji untuk menyediakan layanan terbaik ditanam dalam-dalam pikiran dan hati semua orang di Sriboga Flour Mill.'),
(11, '3.KEUNGGULAN', 'Profesionalisme kami menjamin inovasi yang konsisten untuk mencapai keunggulan. Sriboga Flour Mill sangat sadar bahwa hanya melalui peningkatan konsisten keterampilan, kompetensi dan profesionalisme dalam setiap anggota organisasi akan memastikan keunggulan yang diperlukan untuk bersaing dengan sukses.'),
(12, '4.PROFITABILITAS', 'Keuntungan perusahaan meningkatkan kesejahteraan seluruh anggota struktur organisasi dan masyarakat di mana perusahaan beroperasi. Target yang ditetapkan mencerminkan tingkat yang diperlukan untuk mencapai, untuk melanjutkan, untuk eksis dan berkembang secara berkelanjutan pada tingkat individu dan organisasi, serta dalam lingkungan yang lebih besar.'),
(13, '', ''),
(14, '', '');

