INSERT INTO `faq_jawaban` (`idfaq_jawaban`, `idfaq_kategori`, `idfaq_pertanyaan`, `jawaban`) VALUES
(1, 1, 1, 'Bagian atas cake memuncak disebabkan karena menggunakan terigu berprotein terlalu tinggi, pengocokan yang tidak tepat atau karena oven dibagian atas terlalu panas. Dan untuk solusinya adalah dengan menggunakan terigu berprotein rendah, memperhatikan waktu pengocokan, jangan sampai terlalu lama (over mixing) atau terlalu cepat (under mixing) serta untuk suhu oven bagian atas dapat diturunkan\n'),
(2, 1, 2, 'Bagian atas cake rata disebabkan oleh penggunaan bahan pengembang terlalu banyak, terlalu sedikit cairan, oven kurang panas dan penggunaan lemak terlalu banyak. Dan untuk memperbaikinya dengan menggunakan pengembang (baking powder) yang sesuai dengan formula, menambahkan penggunaan cairan, menaikan suhu pengovenan dan penggunaan jumlah lemak dan telur harus seimbang atau telur lebih banyak dibandingkan lemak'),
(3, 1, 3, 'Kerak cake bagian atas menebal karena terlalu banyak gula, susu atau bahan cair lainnya terlalu sedikit, suhu pengovenan terlalu tinggi/rendah serta adonan cake tidak segera dibakar, solusinya adalah megurangi jumlah  gula yang digunakan, menambahkan penggunaan cairan, mengurangi/menambahkan suhu pengovenan dan segera melakukkan pembakaran setelah adonan selesai di aduk\r\n'),
(4, 1, 4, 'Retak-retak pada permukaan cake disebabkan oleh suhu pengovenan terlalu panas, kelembaban udara dalam oven terlalu rendah, terlalu sedikit penggunaan gula, adonan terlalu kaku dan terlalu banyak adonan dalam cetakan'),
(5, 1, 5, 'Kulit kerak cake terlepas & terkupas disebabkan oleh pencampuran yang terlalu lam, suhu oven terlalu rendah, uang tidak cukup sewaktu pembakaran, mendinginkan cake ditempat dengan kelembaban rendah (kering) dan memagang cake terlalu keras'),
(6, 2, 6, 'Karena proses pembuatannya kurang bersih.'),
(7, 2, 7, 'Biasanya dengan cara dikukus dan digoreng/ dikukus saja.'),
(8, 2, 8, 'Bila menggunakan tepung yang protein rendah, waktu perebusan menjadi lebih singkat. Jika direbus terlalu lama akan cepat lembek. Sebaliknya bila menggunakan tepung berprotein tinggi, waktu perebusan akan lebih lama. '),
(9, 2, 9, 'Proses pengadukan dilihat dari seberapa jauh kemampuan mesin aduk dalam mencampurkan semua bahan yang ada sampai tercampur rata, kemudian adonan diistirahatkan selama 15 menit dan adonan di-roll beberapa kali sampai adonan membentuk lembaran. Jika lembaran terlihat halus dan warnanya rata, tandanya adonan telah diaduk dengan benar. '),
(10, 2, 10, 'Ciri mie yang baik adalah; kenyal, warna mie rata, tidak mudah lembek bila direbus, rasa mie lembut.'),
(11, 3, 11, 'Adonan sulit mengembang disebabkan karena penggunaan ragi kurang atau kualitas ragi kurang baik, pemakaian bread improver kurang, penggunaan gula, garam, telur dan susu terlalu banyak dan kualitas susu kurang baik, penggunaan air kurang & kualitas jelek, kurang waktu pengadukan, temperatur adonan terlalu rendah, waktu fermentasi kurang\r\n'),
(12, 3, 12, 'Warna remah roti tidak rata disebabkan karena jumlah pemakaian bahan kurang tepat, protein tepung yang digunakan terlalu rendah, pemakaian ragi & bread improver terlalu banyak, waktu pengadukan kurang, waktu fermentasi kurang/kelebihan'),
(13, 3, 13, 'Permukaan roti tebal disebabkan karena gluten dari tepung terlalu kuat, penggunaan bread improver terlalu banyak, penggunaan gula, susu bubuk & margarine kurang, salah pengadukan, fermentasi terlalu lama, temperatur pengovenan terlalu rendah dan waktu  terlalu lama'),
(14, 3, 14, 'Aroma roti asam karena pemakaian ragi terlalu banyak, pemakaian garam kurang, temperatur adonan terlalu panas, fermentasi terlalu lama, waktu pembentukan terlalu lama, waktu pengovenan kurang, '),
(15, 3, 15, 'Hasil roti cepat keras disebabkan karena gluten tepung terlalu rendah dan protein rendah, ragi yang digunakan terlalu banyak, pemakaian gula pasir, margarine & air kurang, kualitas susuk bubuk yang digunakan kurang bagus, penggunaan telur telalu banyak, waktu pengadukan kurang, temperatur adonan terlalu panas, waktu fermentasi kurang, waktu pembentukan terlalu lama & penggunaan taburan tepung terlalu banyak, suhu pengovenan terlalu tinggi/rendah dengan waktu terlalu lama, pengemasan kurang bagus'),
(16, 4, 16, '1. Jika adonan kue terlalu lembek, jangan tambahkan tepung lagi. Coba bungkus dengan plastik, masukkan dalam kulkas. Diamkan sekitar 1-2 jam hingga adonan agak mengeras dan bisa dicetak. Kue-kue di toko kue, toko cake, toko cakes, cake shops, cakes shops banyak memakaicara seperti ini.'),
(17, 4, 16, '2. Gunakan telur yang masih baru. Bila telur yang akan dipakai baru saja dikeluarkan dari lemari pendingin, biarkan beberapa saat hingga mencapai suhu ruangan. '),
(18, 4, 16, '3. Jangan campur tepung sekaligus karena kelembapan tepung terigu yang berbeda dapat menjadikan kue keras atau tidak renyah. Toko cake, toko cakes, cake shops, cakes shops, toko kue biasa menggunakan hal seperti ini.'),
(19, 4, 16, '4. Jika terpaksa harus menghentikan pekerjaan membuat macam kue / macam cakes, segera masukkan adonan ke kantong plastik bersih atau wadah plastik kemudian taruh di lemari pendingin. Jika akan meneruskan membuat macam cakes - macam kue, keluarkan adonan, biarkan hingga “lemas” atau tak beku. Adonan bisa/tahan disimpan beberapa hari di dalam kulkas.'),
(20, 4, 16, '5. Hindari membuat kue kering lebih dari satu resep walaupun mungkin special cakes. Bila adonan lebih dari satu resep, adonan yang belum tercetak akan menjadi keras. Yang terjadi adalah kue menjadi kurang renyah. Bisa saja membuat kue murah tapi asal jangan murahan.'),
(21, 4, 16, '6. Jika sudah telanjur mengocok adonan lebih dari satu resep misalnya untuk special cakes, pisahkan adonan mentega dengan tepung terigu. Caranya, ambil sebagian adonan, tuang sebagian tepung terigu, kemudian aduk rata. Setelah itu, cetak/bentuk sesuai selera. Begitu seterusnya sampai adonan habis.'),
(22, 4, 17, 'Telor sebaiknya disimpan di tempat yang sejuk dengan pertukaran udara yang baik, misalnya pada / di dalam rak telor. Telor yang yang akan disimpan sebaiknya jangan dicuci dahulu karena selaput tipis yang melindungi telor akan hilang sehingga pori-pori akan terbuka dan bakteri dapat masuk. Setiap hari telor yang ada di rak telor dibalik supaya kuning telor tetap di tengah. Sisa kuning telor dapat disimpan didalam mangkok dan diatasnya dikasih air dingin yang bersih sampai seluruh kuning telor terendam. Keesokan harinya bila kuning telor belum digunakan , airnya diganti.'),
(23, 4, 18, '1. Apabila kemasan susu UHT telah dibuka, maka susu tersebut harus disimpan pada refrigerator. Susu UHT harus dihindarkan dari penyimpanan pada suhu tinggi (di atas 50 derjat Celcius) karena dapat terjadi gelasi yaitu pembentukan gel akibat kerusakan protein.'),
(24, 4, 18, '2. Kerusakan susu UHT sangat mudah dideteksi secara visual, ciri utama yang umum terjadi adalah kemasan menggembung. Gembungnya kemasan terjadi akibat kebocoran kemasan yang memungkinkan mikroba-mikroba penbusuk tumbuh dan memfermentasi susu. Fermentasi susu oleh mikroba pembusuk menghasilkan gas CO2 yang menyebabkan gembung.'),
(25, 4, 18, '3. Kerusakan juga ditandai oleh timbulnya bau dan rasa yang masam. Selain menghasilkan gas, aktivitas fermentasi oleh mikroba pembusuk juga menghasilkan alkohol dan asam-asam organik yang menyebabkan susu menjadi berflavor dan beraroma masam.'),
(26, 4, 18, '4. Hindari mengkonsumsi susu UHT yang telah mengental. Fermentasi susu oleh bakteri pembusuk juga pembusuk juga menyebabkan koagulasi dan pemecahan protein akibat penurunan pH oleh asam-asam organik. Koagulasi dan pemecahan protein inilah yang menyebabkan tekstur susu rusak yaitu menjadi pecah dan agak kental.\r\n'),
(27, 4, 18, '5. Untuk susu yang belum habis, kami lebih disarankan untuk tetap di simpan dikulkas, dikarenakan produk kami tidak menggunakan bahan pengawet sehingga cukup rentan terhadap bakteri yang sangat cepat berkembang biak dalam susu tersebut.'),
(28, 4, 18, '6. Tetapi apabila tidak memungkinkan untuk dimasukkan kedalam kulkas, sebaiknya susu disimpan dalam keadaan tertutup (rapat) dalam suhu normal tidak terlalu panas.dingin dan jangan terlalu lama didiamkan diluar.\r\n'),
(29, 4, 18, '7. Kualitas kandungan gizi pada susu yang telah dibuka dan didiamkan otomatis akan sedikit berbeda (berkurang) dibanding dengan kualitas gizi pada saat susu pertamakali dibuka, dikarena sudah ada kontaminasi dari udara luar walaupun hanya sedikit. Proses bakteri merusak susu tidak terjadi begitu saja melalui proses terlebih dahulu (ada penguraian) hal ini terjadi dalam hitungan jam sampai akhirnya susu tersebut basi (rasanya jadi asam/pahit, teksturnya menggumpal, ataupun pecah).'),
(30, 4, 18, '8. Apabila memang harus disimpan dalam suhu ruang sebaiknya tidak melebihi dari beberapa jam, kurang lebih 5-7 jam, dan itu pun tergantung dari kondisi lingkungan atau ruangan itu sendiri dan susu sebaiknya dalam keadaan tertutup.\r\n'),
(33, 4, 18, '9. Tapi jika ingin lebih memastikan dapat mencicipinya terlebih dahulu dan melihat teksturnya apabila tidak lagi sama dengan kualitas susu yang biasa Ibu minum sebaiknya jangan dikonsumsi lagi.'),
(34, 4, 18, '10. Tetapi dikarenakan susu disimpan dalam kulkas sehingga pertumbuhan bakteri dapat terhambat untuk sementara, maka kemungkinan susu akan rusak yaitu selama kurang lebih 3-5 hari, tergantung kondisi penyimpanan yang harus dingin (4C) dan kondisi kulkas yang harus baik dan juga tidak terlalu banyak makanan ataupun buah-buahan didalamnya, karena dikhawatirkan aroma dari makanan dan buah-buahan tersebut juga bisa merusak kualitas rasa/aroma dari susu tersebut'),
(35, 4, 18, 'Sebagai saran , agar mengkonsumsi susu dengan ukuran yang lebih kecil agar anak tetap mendapatkan kesegaran susu dan kualitas susu yang terbaik.');

