INSERT INTO `info_produk` (`id`, `nama_produk`, `grup_produk`, `deskripsi_produk`, `url_gambar`, `url_thumbnail`, `submitter`, `approval`, `updated_at`) VALUES
(1, 'Sriboga Double Zero', 1, 'Sriboga Double Zero dari Sriboga adalah tepung segala-olahan hebat terinspirasi dari tepung Italia terkenal, Doppie Zero. Tepung berkualitas unik, Sriboga Double Zero menyediakan fleksibilitas mengagumkan dan kepandaian yang dibutuhkan untuk Pizza berkualitas, Pasta, Kue-kue dan produk Roti Khusus. Sriboga Double Zero pilihan utama untuk applikasi tradisi Eropa seperti focaccia, ciabatta dan roti Italia.', 'public/assets/images/product/slider/double-0.jpg', 'public/assets/images/product/thumbnail/double-0.jpg', NULL, 1, '2017-06-16 06:52:33'),
(3, 'Sriboga Ninja', 1, 'Dari koleksi Signature Kami, Sriboga Ninja adalah tepung khusus inspirasi Jepang diformulasi khusus untuk menghasilkan mie Udon yang hebat,dan bertekstur selembut sutera dan variasi mie putih lainnya. Bakpau dan roti manis kukus juga aplikasi sempurna dari Tepung Sriboga Ninja Jepang kami, menghasilkan roti manis lembut dan halus.', 'public/assets/images/product/slider/ninja.jpg', 'public/assets/images/product/thumbnail/ninja.jpg', NULL, 1, '0000-00-00 00:00:00'),
(4, 'Beruang Biru', 2, 'Beruang Biru diformulasi spesial untuk produksi mie instant. Menghadirkan produk akhir berkualitas dan bernilai jual, Naga Biru dapat diandalkan dan pilihan kualitas untuk kebutuhan anda.', 'public/assets/images/product/slider/bb.png', 'public/assets/images/product/thumbnail/bb.png', NULL, 1, '0000-00-00 00:00:00'),
(5, 'Tali Emas', 2, 'Tali Emas adalah tepung campuran premium, dikembangkan untuk menciptakan kualitas menakjubkan, protein tinggi mie kuning. Naga Emas spesial diformulasi untuk elastisitas sempurna, dan lembut tetapi tekstur kokoh.', 'public/assets/images/product/slider/te.png', 'public/assets/images/product/thumbnail/te.png', NULL, 1, '2017-06-19 03:51:19'),
(6, 'Naga Hijau', 2, 'Naga Hijau adalah tepung ekonomis dan dapat diandalkan untuk produksi mi dan variasi pasta, termasuk makaroni. Sempurna juga untuk produksi goreng-gorengan. Naga Hijau diformulasikan untuk memastikan mie memiliki tekstur yang fleksibel dan berwarna terang.', 'public/assets/images/product/slider/nagahijau.jpg', 'public/assets/images/product/thumbnail/nagahijau.jpg', 8, 0, '0000-00-00 00:00:00'),
(7, 'Pita Merah', 2, 'Pita merah adalah tepung yang dapat diandalkan. Jika anda mencari tepung mie yang ekonomis, tetapi tidak mau berkompromi soal kualitas, Naga Merah hadir untuk anda. Sempurna untuk mie kuning, mie kering, mie instant, makaroni dan pasta. Kami menjamin elasitas tinggi, tekstur yang fleksibel dan warna yang terang.', 'public/assets/images/product/slider/pm.png', 'public/assets/images/product/thumbnail/pm.png', NULL, 1, '2017-06-19 03:51:13'),
(8, 'Sriboga HIME', 1, 'Sriboga Hime, dari koleksi Signature kami, sangat cocok untuk Ahli pembuat kue. Hime mencerminkan tekstur yang unik yang menjadi ciri khas tradisional Eropa bergaya perapian roti. Tepung yang benar-benar canggih menghadirkan adonan menyenangkan dan bisa diterapkan. Sriboga  HIME memiliki kandungan protein 12.0 - 13.5%.', 'public/assets/images/product/slider/hime.jpg', 'public/assets/images/product/thumbnail/hime.jpg', NULL, 1, '0000-00-00 00:00:00');

