INSERT INTO `resep_langkah` (`id`, `id_resep`, `nomor_langkah`, `instruksi`) VALUES
(5, 2, 1, 'Heat oven to 375f'),
(6, 2, 2, 'Mix sugars, butter, vanilla and egg in large bowl. Stir in flour, baking soda and salt (dough will be stiff). Stir in nuts and chocolate chips'),
(7, 2, 3, 'Drop dough by rounded tablespoonfuls about 2 inches apart onto ungreased cookie sheet'),
(8, 2, 4, 'Bake 8 to 10 minutes or until light brown (centers will be soft). Cool slightly; remove from cookie sheet. Cool on wire rack'),
(9, 3, 1, 'Combine ground beef, onion, garlic, and green pepper in a large saucepan. Cook and stir until meat is brown and vegetables are tender. Drain grease'),
(10, 3, 2, 'Stir diced tomatoes, tomato sauce, and tomato paste into the pan. Season with oregano, basil, salt, and pepper. Simmer spaghetti sauce for 1 hour, stirring occasionally.'),
(15, 5, 1, 'Preheat oven to 425 degrees F (220 degrees C). Melt the butter in a saucepan. Stir in flour to form a paste. Add water, white sugar and brown sugar, and bring to a boil. Reduce temperature and let simmer.'),
(16, 5, 2, 'Place the bottom crust in your pan. Fill with apples, mounded slightly. Cover with a lattice work crust. Gently pour the sugar and butter liquid over the crust. Pour slowly so that it does not run off.'),
(17, 5, 3, 'Bake 15 minutes in the preheated oven. Reduce the temperature to 350 degrees F (175 degrees C). Continue baking for 35 to 45 minutes, until apples are soft.'),
(20, 7, 1, 'Aduk semua bahan kering, tambahkan air dan telur aduk sampai khalis.'),
(21, 7, 2, 'Masukan butter aduk sampai elastic.Istirahatkan selama  45’ lalu masukan campuran buah kering dan kacang aduk sampai tercampur.'),
(22, 7, 3, 'Aduk semua bahan kering, tambahkan air dan telur aduk sampai khalis.'),
(23, 7, 4, 'Masukan butter aduk sampai elastic. Istirahatkan selama  45’ lalu masukan campuran buah kering dan kacang aduk sampai tercampur.'),
(24, 7, 5, 'Aduk semua bahan kering, tambahkan air dan telur, aduk sampai khalis.'),
(25, 7, 6, 'Masukkan butter, aduk sampai elastic. Istirahatkan selama 45'' lalu masukkan campuran buah kering dan kacang. Aduk sampai tercampur.'),
(26, 7, 7, 'Istirahatkan lagi selama 30'', lalu timbang @400gr dan bentuk, kemudian fermentasikan, lalu oven dengan suhu 200 derajat Celcius'),
(28, 10, 1, 'Kocok kuning telur,putih telur ,emulsifier dan gula pasir sampai mengembang dan kental.'),
(29, 10, 2, 'Masukan campuran terigu,susu bubuk dan maezena lalu aduk rata.'),
(30, 10, 3, 'Masukan campuran margarine kocok dengan abon lalu aduk rata.'),
(31, 10, 4, 'Tuang dalam cetakan yang sudah dialasi kertas roti dan dipoles margarine,taburi dengan keju parut.'),
(32, 10, 5, 'Panggang selama 25 menit dengan sushu 180 derajat Celcius.'),
(33, 11, 1, 'Campurkan terigu, baking powder, cinamon dan pala  serta gula pasir aduk rata sisihkan.'),
(34, 11, 2, 'Cairkan butter dan madu, kocok telur sampai kental tambahkan susu cair kocok sampai tercampur, tambahkan butter cair aduk rata.'),
(35, 11, 3, 'Lalu campurkan dengan bahan kering  aduk rata.'),
(36, 11, 4, 'Tuang dalam cetakan muffin, lalu panggang dengan suhu 200 derajat Celcius sampai matang.'),
(91, 12, 1, 'Dissolve yeast in warm water in a large bowl; let stand 5 minutes. Lightly spoon flour into dry measuring cups; level with a knife. Add 2 3/4 cups flour to yeast mixture; stir until a soft dough forms. Cover and let stand 15 minutes. Turn dough out onto a lightly floured surface; sprinkle evenly with salt. Knead until the salt is incorporated and the dough is smooth and elastic (about 6 minutes); add enough of remaining flour, 1 tablespoon at a time, to prevent dough from sticking to hands (dough will feel slightly sticky).'),
(92, 12, 2, 'Place dough in large bowl coated with cooking spray, turning to coat top. Cover and let rise in warm place (85°), 40 minutes or until doubled in size. (Gently press two fingers into dough. If an indentation remains, the dough has risen enough.) Punch dough down; cover and let rest 5 minutes. Divide in half. Working with 1 portion at a time (cover remaining dough to prevent drying), roll each portion on a floured surface into 12-inch rope, slightly tapered at ends. Place ropes on large baking sheet sprinkled with cornmeal. Lightly coat dough with cooking spray, and cover; let rise 20 minutes or until doubled in size.'),
(93, 12, 3, 'Uncover the dough. Cut 3 (1/4-inch-deep) diagonal slits across top of each loaf. Bake at 450° for 20 minutes or until browned on bottom and sounds hollow when tapped.');

